import React, { Component } from 'react';
import { Link, Outlet } from 'react-router-dom';
class ClassCompoMenu extends Component {
    render() {
        return (
            <>
                <ol>
                    <li>
                        <Link to="component">what is component</Link>
                    </li>
                </ol>
                <div className='row'>
                    <div className="col">
                        <Outlet />
                    </div>
                </div>
            </>
        );
    }
}

export default ClassCompoMenu;
